(1, 'Andrea Magri', '155.444.828-02', 'deamagri@gmail.com', '(11) 99880-8052', 'Estou muuuuito decepcionada, desapontada e, acima de tudo, triste. Há 2 dias atrás vi o PDV (lojas americanas) decorado com a promoção. Comprei os produtos de forma a cumprir com o valor, esperei abrir o site e cadastrei! Então deu erro, data inválida, cupom inválido...\r\nSe as compras são válidas a partir do dia 21, o PDV não deveria ser preparado antes, pois foi a única razão de eu ter comprado! Induzir a compra fora do período promocional certamente pode ser encaixado como falta segundo o código de defesa do consumidor. Vou verificar essa informação, enquanto aguardo seu posicionamento sobre o fato. Grata', '2020-02-21 11:53:53', NULL),
(2, 'Vanessa Ries', '004.703.930-25', 'nessaries@yahoo.com.br', '(51) 98112-9628', 'Bom dia, estou tendo dificuldade para atualizar meu cadastro e cadastrar o cupom, toda vez que tento preencher qualquer uma das informações (Nome, Sobrenome, telefone, cep,...) aparece a mensagem &amp;quot;senhas divergentes&amp;quot; e não é possivel efetuar o cadastro.\r\natt', '2020-02-21 11:55:43', NULL),
