(5, 'Terlei Terezinha NORD DAS Neves', '018.374.899-98', 'terleiterezinha@gmail.com', '(48) 99107-8714', 'BOM DIA\r\nTA DANDO ERRO SITE\r\nQUANDO VOU CADASTRAR MEU CUPOM NAO CONSIGO CADASTRAR MEUS DADOS\r\nFALA QUE EMAIL CADASTRADO E \r\nSENHAS DIVERGENTES EM TODAS AS LINHAS COM MEUS DADOS\r\nAPARECE SENHA DIVERGENTE\r\n\r\nEU TANDO LOGADA  COMPLETANDO MEU CADASTRO\r\n\r\nOBRIGADA', '2020-02-21 13:04:23', NULL),
