(9, 'Rener Hemerson Gomes Oliveira', '128.914.137-17', 'renerhemerson@gmail.com', '(27) 99803-0210', 'Estou tentando cadastrar meu cupom, porém ao cadastrar meus dados e salvar aparece uma mensagem de erro com a mensagem: Senhas divergentes. Essa frase aparece abaixo de todos os campos que estão meus dados, não me permitindo avançar para que eu possa cadastrar o meu cupom fiscal.', '2020-02-21 16:04:18', NULL),
