(12, 'camila das graças andrade', '332.422.298-27', 'camila.andrade86@gmail.com', '(11) 98222-9107', 'Boa tarde! \r\n\r\nVenho por meio deste informar minha insatisfação com a entrega do meu pedido. \r\nEfetuei minha primeira compra no dia 11/02 /2020, cuja compra seria para ultilizar as balas em um aniversário e  até o momento não recebi, e em contato com o 0800 de vocês, fui informada que meu pedido não seria entregue devido a um extravio, ou avaria! \r\nA única solução seria ou o estorno ou a entrega do mesmo pedido, porém somente com precisão de entrega dentro de 7 dias úteis...\r\nSendo assim estou me sentindo frustrada, uma vez que o prometido não foi cumprido e eu não irei conseguir usar as balas para o aniversário!', '2020-02-21 19:40:28', NULL),
