(17, 'Raphael Francis Nunes', '066.835.149-76', 'raphaelnns@hotmail.com', '(41) 99957-3486', 'Boa tarde,\r\n\r\nGanhei um par de ingressos, mas não estou conseguindo cadastrar o meu cupom fiscal.\r\nToda hora que eu tento cadastrar diz que tem completar o cadastro. Quando vou completar aparece a msg, senha divergente e não consigo cadastrar.\r\n\r\nQuero meus ingressos, me ajudem.\r\n\r\nNo aguardo\r\n\r\nAtt \r\nRaphael Francis Nunes', '2020-02-22 18:14:26', NULL),
(18, 'Gessika Samara', '148.890.237-20', 'gessikasamara@hotmail.com', '(21) 96986-3875', 'Comprei as balas fini para participar da promoção dia 19/02/20 pois pensava que já tava valendo , nas lojas americanas estava o papel lá da promoção como já estivesse valendo , chego em casa vim fazer o cadastro e não vai pq foi comprado dia 19 e não dia 21 ,quando começa , mas não tinha nada falando que só ia começar a vale nesse dia , isso é muito errado , e agora ? Comprei para pode participar da promoção e agora não vou pode ? Se não tava ainda funcionando , pq coloca o papel de aviso lá , como já podesse participar , espero um retorno , muito chateada ??????', '2020-02-22 19:52:15', NULL),
(19, 'nathan alexandre rocha tatarevic', '038.118.521-40', 'warnathan2015@gmail.com', '(11) 95337-0697', 'ola\r\n\r\nquero cadastrar o cupom\r\npara isso devo ir em preencher dados\r\nai eu preencho os dados\r\nai diz que as senhas são divergentes\r\ninteressante\r\n\r\ndigito nome.... senha divergente\r\nemail ... senha divergente\r\ntelefone ... senha divergente\r\n\r\nai fui la em outros 3 navegadores.... mesmo erro.\r\nai fui la no meu celular.... mesmo erro..\r\nai fui la no computador da vizinha.... mesmo erro\r\nai fui la no celular da vizinha.... mesmo erro...\r\n\r\nviu... como faz pra participar desse jeito?', '2020-02-22 23:01:23', NULL),
