(23, 'Juliana Rocha bandeira', '127.270.876-40', 'julianagaslove@hotmail.com', '(33) 99958-9694', 'Olá, infelizmente fiz minha compra no dia 15/02/2020 nas lojas americanas ,ondena mesma possuia um pequeno baner informando da promoção ,mas ao entrar no site da mesma ,tive o desprazer de saber que à data específica para participar da promoção seria partir do dia 21/02/2020 ,fiquei muito triste pois não constava esta data periodo no banaer e agora não poderei  participar da promoção. Faltou empatia da empresa Fini com o cliente  em não colocar à data vigente de início da promoção no baner ,por isso entrei em contato e gostaria de um posicionamento da empresa para comigo ,que sou cliente assídua da marca. Estou aguardando o contato.', '2020-02-24 16:09:42', NULL),
